function ChangeSupplierDisplayStyle(n){const t=document.getElementsByClassName("inactive");for(let i=0;i<t.length;i++){const r=t.item(i);r.style.display=n}}class SupplierManagement{constructor(){this.SetSupplierEvents=()=>{document.getElementById("inactive-supplier-checkbox").style.display="block";ChangeSupplierDisplayStyle("none");const n=document.getElementById("ShowInactiveSuppliers");n.addEventListener("click",this.ChangeSupplierDisplay)}}ChangeSupplierDisplay(){this.checked?ChangeSupplierDisplayStyle("table-row"):ChangeSupplierDisplayStyle("none")}}window.onload=function(){const n=new SupplierManagement;n.SetSupplierEvents()};